-- Usefull functions

function createsound(id,pitch,volume,parent)
	coroutine.resume(coroutine.create(function()
	local sound = Instance.new("Sound",parent)
	sound.SoundId = "rbxassetid://"..id
	sound.PlaybackSpeed = pitch
	sound.Volume = volume
	sound:Play()
	repeat
	game:GetService("RunService").Heartbeat:Wait()	
	until sound.Playing == false
	sound:Destroy()	
	end))
end


function GetDudesTorso(c)
local torsy = (c:findFirstChild("Torso") or c:findFirstChild("UpperTorso"))
if torsy ~= nil then
return torsy
end
end

function CamShake(par,magni,env,dur)
for _, c in pairs(workspace:GetDescendants()) do
local hum = c:FindFirstChildOfClass("Humanoid")
if hum ~= nil and c:FindFirstChild("SHAKE")==nil then
local head = GetDudesTorso(c)
if head ~= nil then
local targ = head.Position - par.Position
local mag = targ.magnitude
if magni >= mag then
local sheiku = script:FindFirstChild("SHAKE"):Clone()
sheiku.Parent = c
sheiku:FindFirstChild("Env").Value = env
sheiku:FindFirstChild("Dur").Value = dur
sheiku.Disabled = false
end
end
end
end
end

function fastwave(pos,trans)
	coroutine.resume(coroutine.create(function()
	local part = Instance.new("Part",workspace)
	part.Locked = true
	part.BrickColor = BrickColor.new("White")
	part.CanCollide = false
	part.Anchored = true
	part.Transparency = trans
	part.CFrame = pos
	local wavemesh = Instance.new("SpecialMesh",part)
	wavemesh.MeshId = "rbxassetid://169412804"
	local a = 0
    for i = 0,5,0.3 do
	game:GetService("RunService").Heartbeat:Wait()
    a = a + 15
    part.CFrame = pos*CFrame.Angles(0,a,0)
    part.Transparency = part.Transparency + 0.07
	wavemesh.Scale = wavemesh.Scale + Vector3.new(0.6,0.25,0.6)		
	end	
	part:Destroy()	
	end))
end

