function spawnbeartrap(pos)
	coroutine.resume(coroutine.create(function()
		local beartraplol = Instance.new("Part", workspace)
		beartraplol.Size = Vector3.new(2, 0.5, 2)
		beartraplol.Anchored = false
		beartraplol.CanCollide = false
		beartraplol.CFrame = pos
		debris:AddItem(beartraplol, 4.5)

		local beartrapmesh = Instance.new("SpecialMesh", beartraplol)
		beartrapmesh.MeshId = "rbxassetid://470962113"
		beartrapmesh.TextureId = "rbxassetid://470965980"
		beartrapmesh.Scale = Vector3.new(0.005, 0.005, 0.005)

		local bv = Instance.new("BodyVelocity", beartraplol)
		bv.MaxForce = Vector3.new(math.huge, math.huge, math.huge)
		bv.Velocity = -pos.UpVector * 50

		task.wait(0.1)
		beartraplol.CanCollide = true
		bv:Destroy()

		beartraplol.Touched:Connect(function(hit)
			if not hit or not hit.Parent then return end
			if hit.Parent == ch then return end
			if not hit.Parent:FindFirstChildOfClass("Humanoid") then return end

			createsound(2019418800, 1, 2, hit.Parent)

			beartraplol:Destroy()
		end)
	end))
end

