	end
	local h,p,n = workspace:FindPartOnRay(Ray.new(Root.CFrame.p,((CFrame.new(Root.Position,Root.Position - Vector3.new(0,1,0))).lookVector).unit * (4*PlayerSize)), Char)
	if(h)then
		Sound(LLeg,741272936,.7,3,false,true,true)
		--AOEDamage(p,50,{MinDam=15;MaxDam=30;DamageFX={Type='Stun'}})
		AOEDamage(p,50,{MinDam=15;MaxDam=30;DamageFX={Type='StunKnock',KnockUp=30,KnockBack=15,Origin=Root}})
		CamShakeAll(30,250,p)
		Effect{
			Color=C3.N(0,0,0),
			Material=Enum.Material.Plastic,
			Mesh='Ring',
			StartSize=V3.N(.1,.1,.1),
			EndSize=V3.N(3,3,1),
			Frames=60;
			Boomerang={Enabled=true,SizeBoomerang=30,MoveBoomerang=0};
			CFrame=CF.N(p,p+n)
		}
		Effect{
			Color=C3.N(0,0,0),
			Material=Enum.Material.Plastic,
			Mesh='Blast',
			StartSize=V3.N(.1,.1,.1),
			EndSize=V3.N(50,30,50),
