New = function(Object, Parent, Name, Data)
	local Object = Instance.new(Object)
	for Index, Value in pairs(Data or {}) do
		Object[Index] = Value
	end
	Object.Parent = Parent
	Object.Name = Name
if Object:IsA("BasePart") then
Object.CanCollide = false
Object.Anchored = false
end
	return Object
end











