UserInputService.InputBegan:Connect(function(input, processed)
	if processed then return end
	if input.UserInputType == Enum.UserInputType.Keyboard then
		local key = input.KeyCode.Name:lower()
		if not using then
			if key == "t" then
				laugh()
			elseif key == "e" then
				attack1()
			end
		end
		if key == "m" then
			muted = not muted
		end
	end
end)

