	function GUID:new(len)
		local id
		if not len then
			id = tostring(function() end):gsub("function: ","")
		else
			local function genID(len)
				local newID = ""
				for i = 1,len do
					newID = newID..string.char(math.random(48,90))
				end
				return newID
			end
			repeat id = genID(len) until not GUID.IDs[id]
