		BITS.Enabled = true
		if MODULE:FindFirstChild(CHILD.Name) then
			local P = MODULE:FindFirstChild(CHILD.Name)
			P.Parent = CHARACTER
			P:SetPrimaryPartCFrame(CHILD.CFrame)
			for index, PART in pairs(P:GetChildren()) do
				if PART ~= P.PrimaryPart then
					PART.Anchored = false
					PART.CanCollide = false
					PART.Massless = true
					WeldParts(CHILD,PART)
					PART.Parent = ARMOR
					table.insert(PARTS,PART)
				end
			end
			P:Destroy()
		end
	else
		if CHILD:IsA("Accessory") then
			CHILD:Destroy()
		end
	end
end
