function Speech(INPUT)
	ATTACKING = true
	if INPUT == "t" then
		Speak(2316600989)
	elseif INPUT == "y" then
		Speak(2290634374)
	elseif INPUT == "u" then
		Speak(2291325961)
	end
	ATTACKING = false
end

